import React, { Component } from "react";
import List from "./List";

export class BoardLists extends Component {
	constructor(props){
		super(props)
	}
	componentDidMount() {
		fetch(
			"https://api.trello.com/1/boards/616801f620f6b16ea3839f59/lists?key=a32c5c0c541016f7fd5c81bc1e4e47ef&token=a4711b0c6df1e11c11b241284521cf44441681fb61c66088f45fae8a9a4501f6",
			{
				method: "GET",
			}
		)
			.then((response) => {
				return response.json();
			})
			.then((data) => console.log(data))
			.catch((err) => console.error(err));
	}

	render() {

		return (
			<div className="flex">
				<List />
			</div>
		);
	}
}

export default BoardLists;
